jenkins:
  agentProtocols:
  - "JNLP4-connect"
  - "Ping"
  clouds:
  - docker:
      disabled:
        disabledByChoice: true
        enabledByChoice: false
      dockerApi:
        connectTimeout: 60
        dockerHost:
          uri: "http://l5-jenkins.ent.stateauto.com:2376"
        readTimeout: 60
      name: "docker"
  - ecs:
      cluster: "arn:aws:ecs:us-east-1:268700624367:cluster/L1-13-App-ECSCluster"
      credentialsId: "AKIAIMUAIKLULO6II4YQ"
      jenkinsUrl: "http://l5-jenkins.ent.stateauto.com:8080/"
      name: "Test_ECS"
      regionName: "us-east-1"
  disableRememberMe: false
  globalNodeProperties:
  - envVars:
      env:
      - key: "GRADLE_OPTS"
        value: "-XX:+UseConcMarkSweepGC -Xmx16g -XX:-UseGCOverHeadLimit"
  labelString: "node packer master"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  numExecutors: 8
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: false
  scmCheckoutRetryCount: 0
  securityRealm:
    ldap:
      cache:
        size: 200
        ttl: 1800
      configurations:
      - displayNameAttributeName: "displayName"
        groupMembershipStrategy:
          fromGroupSearch:
            filter: "(&(objectCategory=group)(member:1.2.840.113556.1.4.1941:={0}))"
